We are going to make our first function for this script. # Define LOG variables
LOG_VARS() { export LOG_LOGFILE_ENABLE=${LOG_LOGFILE_ENABLE:-1} # Enable logging to file export LOGFILE=${LOGFILE:-"$HOME/tmp/bash-logger/my-bash-logger.log"} export LOG_FORMAT=${LOG_FORMAT:-$DEF_LOG_FORMAT} export LOG_DATE_FORMAT=${LOG_DATE_FORMAT:-$DEF_LOG_DATE_FORMAT} #Eg:2014-09-07 21:51:57 export LOG_COLOR_ENABLE=${LOG_COLOR_ENABLE:-1} # Enable colors by default export LOG_LEVEL=${LOG_LEVEL:-${LOG_LEVELS[DEBUG]}} # Logs all messages to the terminal export LOG_COLOR_DEBUG=${LOG_COLOR_DEBUG:-"\033[0;34m"} # Blue export LOG_COLOR_INFO=${LOG_COLOR_INFO:-"\033[0;37m"} # White export LOG_COLOR_NOTICE=${LOG_COLOR_NOTICE:-"\033[1;32m"} # Green export LOG_COLOR_WARNING=${LOG_COLOR_WARNING:-"\033[1;33m"} # Yellow export LOG_COLOR_ERROR=${LOG_COLOR_ERROR:-"\033[1;31m"} # Red export LOG_COLOR_CRITICAL=${LOG_COLOR_CRITICAL:-"\033[44m"} # Blue Background export LOG_COLOR_ALERT=${LOG_COLOR_ALERT:-"\033[45m"} # Purple Background export LOG_COLOR_EMERGENCY=${LOG_COLOR_EMERGENCY:-"\033[41m"} # Red Background export RESET_COLOR=${RESET_COLOR:-"\033[0m"}
} # Set LOG variables
LOG_VARS Bash colours(colors) are implemented when used in conjunction with octal/ANSI escape codes \033[0;34m, see https://www.shellhacks.com/bash-colors/ for further explanation. If a variable isn't set earlier on or later by some other process of the user bash lets you apply a default value in case of this: So, if the LOGFILE is not initialised then LOGFILE:-"$HOME/tmp/bash-logger/my-bash-logger.log" will apply the default log file path location as $HOME/tmp/bash-logger/my-bash-logger.log. The last line here, LOG_VARS is how we call a function in a bash script

