Now we are going to be creating the 8 of the syslog logging levels with an additional 1 to turnoff logging: | OFF | ERROR | CRITICAL | | DEBUG | INFO | ALERT | | NOTICE | WARNING | EMERGENCY | #----------------------------------------------------------------------------------------
# Individual Log Functions
# These can be overwritten to provide custom behavior for different log levels OFF() { LOG_HANDLER_DEFAULT "$FUNCNAME" "$@"; }
DEBUG() { LOG_HANDLER_DEFAULT "$FUNCNAME" "$@"; }
INFO() { LOG_HANDLER_DEFAULT "$FUNCNAME" "$@"; }
NOTICE() { LOG_HANDLER_DEFAULT "$FUNCNAME" "$@"; }
WARNING() { LOG_HANDLER_DEFAULT "$FUNCNAME" "$@"; }
ERROR() { LOG_HANDLER_DEFAULT "$FUNCNAME" "$@"; exit 1; }
CRITICAL() { LOG_HANDLER_DEFAULT "$FUNCNAME" "$@"; exit 1; }
ALERT() { LOG_HANDLER_DEFAULT "$FUNCNAME" "$@"; exit 1; }
EMERGENCY() { LOG_HANDLER_DEFAULT "$FUNCNAME" "$@"; exit 1; } So again probably some new syntax and commands are standing out. $FUNCNAME contains the names of shell functions on the execution call stack, it can store an array of functions. $@ expands into a list of separate parameters, where as $* is one parameter consisting of all the parameters added together. Hopefully you remember from other content you have learned at UoG that exit 0 and is explicit means no error, exit 1 is an error and is implicit.
